goals:
The objective of this project is to participate in the restoration of the forest cover in the district of Ignié.
These are:
- Awareness and training of communities on the challenges of climate change, sustainable
development, and forest protection;
- Produce and supply forest seedlings;
- Establish 10ha of forestry and agroforestry plantation;
- Transform the vision of small producers into modern entrepreneurs;
- Monitor and maintain the agroforestry systems in place and the afforested plots.
